import React from 'react'
const Profile = (props) => {
  return (
    <span style={{ marginLeft: "90%" }}>
    <div style={{textAlign:"center",width:"8vw",marginLeft:"90%",border:"solid 1px black", borderRadius:"100px",padding:"2%",fontSize:"3vh"}}> {props.Name}</div>
    </span>
  )
}

export default Profile
